import Categoryy from "../com/Categoryy";
import CourseDet from "../com/CourseDet";

const Category = () => {
    return (
        <div>
           <div className='flex bg-[#020917] ml-54 '>
                 <CourseDet/>
                 <Categoryy/>
            </div>
        </div>
    )
}

export default Category;
